data:
  definition: état d'un ensemble de ressources dans lequel une tentative de prise
    ne peut aboutir pas à une prise immédiate
  examples: []
  notes:
  - Un encombrement n'entraîne pas nécessairement le non-aboutissement d'une tentative
    d'appel si la communication peut s'établir après un certain temps ou en utilisant
    d'autres ressources.
